import React from 'react'

interface IButtonProps{
  buttonLabel: string;
}

const Button = (props: IButtonProps) => {
  return (
    <>
    <button className="w-28 m-8 h-10 text-pink-400 bg-white rounded-lg hover:-translate-y-0.5  duration-300">{props.buttonLabel}</button>
    </>
  )
}

export default Button
